import React, { Component } from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid'
import Articulo from "../pages/Articulo"


export default class NestedGrid extends Component {
    constructor(props){
        super(props);
        this.state={
            items:[]
        };

        this.useStyles = makeStyles({
                root: {
                    flexGrow: 1,
                  },
                card: {
                    padding: '8px',
                    textAlign: 'center',
                    maxWidth: 345,
                },
                media: {
                    height: 160,
                },
              })
        

        
    }
    render() {
        
        return(
            <Grid container xs={12} spacing={3}>
                 <React.Fragment>
                {
                this.state.items.map((articulo)=>(
                    
                    <Articulo articulo={articulo} ver={articulo.ver} estilo={this.useStyles}/>
                    
                )
          ) }}
          </React.Fragment>
            </Grid>
            
          ) 
    }
}
